import React, { Component } from 'react'

class About extends Component {
    render() {
        return (
            <div className="container">
            <div className="grey-text text-lighten-1" style={{padding:'20px', margin:'auto', display:'block'}}>
                <h6>Get all the information you need about your favourite movies and TV shows, just by doing a simple search</h6>
            </div>
            </div>
        )
    }
}
export default About
